function AboutMe() {
    return (
      <section id="about" className="bg-gray-100 py-10 px-6">
        <div className="max-w-4xl mx-auto text-center">
          <h2 className="text-3xl font-bold mb-6">About Me</h2>
          <p className="text-lg text-gray-700">
            I'm a software developer specializing in building web applications with React and Node.js.
          </p>
          <p className="mt-4 text-lg text-gray-700">Skills: JavaScript, React, Node.js, Python, SQL</p>
        </div>
      </section>
    );
  }

export default AboutMe;
